import React,{Component} from 'react';
import { Card } from "antd";
import TxtTag from "../txtTag"
import data from "./data"
class Detail extends Component{
    render(){
        const title =(<div>
            <h1>{data.data.title}</h1>
                <div>
                    <TxtTag />
                </div>
            </div>);
        return (<div className="wrap">
            <Card
                title = {title}
            >
            </Card>
        </div>)
    }
}
export default Detail;
